import { styled } from '@mui/system'
import { Button, Paper } from '@mui/material'

export const ButtonTool = styled(Button)({
    margin: '0px 4px 0px 4px'
})

export const PaperStyled = styled(Paper)({
    padding: 8
})

export const ButtonBox = styled('div')({
    display: 'flex'
})
